import './App.css';
const axios = require('axios');


function App() {
  const data = {
    laanebeløp: 2000000,
    nominellRente: 3,
    terminGebyr: 30,
    utløpsDato: "2045-01-01",
    saldoDato: "2020-01-01",
    datoForsteInnbetaling: "2020-02-01",
    ukjentVerdi: "TERMINBELØP"
  }

  const options = {
    headers: {'Content-type':'application/json'}
  }

  axios.post('https://visningsrom.stacc.com/dd_server_laaneberegning/rest/laaneberegning/v1/nedbetalingsplan', data, options).then(function (response) {
      console.log(response);
    })
    .catch(function (error) {
      console.log(error);
    });


    return (
